import './App.css';
import { useEffect, useState } from 'react';

export default function App() {

  useEffect(()=>{
    fetch("https://newsapi.org/v2/everything?q=microsoft&from=2023-12-24&to=2023-12-25&apiKey=751416c4b408499e9d536de309a31f43")
    .then((response)=>response.json())
    .then((data)=>{
      console.log(data);
    })
    .catch((err)=>{
      console.log(err);
    })
  }, [])
  return (
    <div className="App">
      <h1>News App</h1>
    </div>
  );
}


